import React from "react";

const History = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <h1 className="text-3xl font-bold text-center text-white bg-gradient-to-r from-blue-500 to-purple-500 py-4 rounded-md w-full">
        Real-Time Transcription
      </h1>
      <div className="bg-white rounded-lg shadow-lg p-6 mt-6 w-11/12 md:w-3/4 lg:w-2/3">
        <div className="flex justify-center space-x-2 mb-4">
          <button
            className="px-4 py-2 rounded-lg bg-blue-600 text-white font-medium hover:bg-blue-700"
          >
            Live Transcription
          </button>
          <button
            className="px-4 py-2 rounded-lg bg-gray-400 text-white font-medium hover:bg-gray-500"
          >
            History
          </button>
        </div>
        <p className="text-center text-gray-500">No history available yet.</p>
      </div>
    </div>
  );
};

export default History;
